('5eb1b228-e35f-4da8-a95d-f4a500c19bb0', 'Cho thuê phòng trọ sạch sẽ, an ninh tại Đình Phong Phú, TNP.B, quận 9. Giá 3tr1/tháng', '3', 'COPN', 'Địa chỉ: Phố trọ 2, 86/22T, Đường Đình Phong Phú, Phường Tăng Nhơn Phú B, Quận 9, Hồ Chí Minh', '29671527-afc7-4c22-a904-0bd609a91884', 'CTPT', '[\"Vị trí hệ thống phòng trọ: Tòa nhà 1 trệt 2 lầu nằm ngay số 86/22T, Đường Đình Phong Phú, Phường Tăng Nhơn Phú B, Quận 9, Hồ Chí Minh (Phố trọ 2) cổng màu đỏ.\",\"Hẻm lớn: Đường xe hơi vô được, Khu dân cư trung và cao cấp, Khu vực an ninh và yên tĩnh, Khu vực cao ráo không hề ngập nước.\",\"Cách mặt tiền đường 100m.\",\"Cách đường lê văn việt: 1 phút (xe máy).\",\"Cách ngã tư Thủ Đức: 5 phút (xe máy).\",\"Gần chợ: Chợ nhỏ, chợ mới, chợ đình phong phú.\",\"Gần Siêu thị: Coopmark xa lộ hà nội, vincom quận 9, siêu thị mini, nhà trẻ: Ngay đầu hẻm.\",\"Gần Trung tâm: Tập thể hình.\",\"Rất nhiều trạm xe buýt ngay đầu hẻm.\",\"………………………………………….\",\"Khu trọ có hệ thống giếng trời nằm ngay giữa khu: Diện tích lên đến 50m. Mang đến sự riêng tư cao cho từng phòng.\",\"Các phòng trên lầu có ban công nhìn ra ngoài: Diện tích cửa kính+ cửa lá sách nhôm tĩnh điện lên đến 9m. Tầm nhìn đẹp và thoáng mát suốt ngày.\",\"Khoảng sân trống (chưa bao gồm giếng trời) lên đến: 80m.\",\"Xe máy để khu vực tầng trệt.\",\"Hệ thống camera an ninh khắp khu trọ.\",\"Wifi tốc độ cao, truyền hình cáp.\",\"Bảo vệ 24/24 giữ xe.\",\"Khoá cửa vân tay.\",\"Không chung chủ.\",\"…………………………………………..\",\"Mô tả phòng trọ:\",\"Diện tích phòng: 28m2 đến 40m2\",\"Ban công trong từng phòng: lên đến 9m. (Cửa kiếng+ cửa lá sách: cực mát - tiết kiệm điện - ko cần sử dụng máy lạnh)\",\"Phòng đẹp, thoáng mát, sang trọng.\",\"Ốp gạch tường trong và ngoài phòng trọ.\",\"Gác lửng: Ốp gỗ cao cấp: Mang đến vẽ đẹp sang trọng và đẳng cấp.\",\"Bếp: Tủ bếp + bồn rửa chén: Mặt bếp ốp đá hoa cương.\",\"Toilet: Ốp và lát gạch cao cấp: Vòi sen+ vọi xịt: Inox.\",\"Cửa đi, cửa sổ: Sắt hộp chắc chắn, đẹp và sang trọng.\",\"Đồng hồ điện, đồng hồ nước: Trong từng phòng.\",\"Cầu thang từng phòng trọ: Có thể di chuyển được khi cần thêm không gian.\",\"Sử dụng toàn nước máy.\",\"Dịch vụ nước bình các thương hiệu: Vĩnh Hảo, Lavie, Birico.\",\"Giá thuê phòng: 3tr1 tháng (28 - 30m2)\",\"……………………………………………\",\"Hãy nhanh chân gọi ngay theo số: 0909.55.26.29 (gặp Ms Ngọc - chủ nhà) để đặt và giữ chỗ cho mình một phòng vừa ý.\",\"Dưới là ảnh phòng thực tế của phòng 3 triệu/tháng. Khách quan tâm liên hệ xem trực tiếp.\"]', 'a279c3ed-436a-4281-b002-12cebc7b922b', '53226388-8bb4-4d5a-b829-973c650dc68b', '64fd35c5-edd5-41e7-9985-06b40e4c5a7c', '2023-09-01 05:39:42', '2023-09-01 05:39:42'),
