('9fdc19c7-1609-42d4-8f4d-e1b464ebc415', 'Căn hộ đủ đồ tai Trần Quốc Hoàn - Giá siêu hấp dẫn', '2', 'CUNA', 'Địa chỉ: Trần Quốc Hoàn, Phường Dịch Vọng Hậu, Quận Cầu Giấy, Hà Nội', '2ac8c114-4c5d-46c6-a4dc-dcbddda461a0', 'CTCH', '[\"Tòa nhà căn hộ 7 tầng - 20 phòng căn hộ cho thuê dài hạn.\",\"Diện tích 20-25-30m2\",\"Đủ đồ: Giường, Đệm, Tủ , Điều hòa, Nóng lạnh, Hầm để xe, khép kín\",\"Phù hợp với các bạn sinh viên, các đang đi làm, cặp vợ chồng trẻ, chuyên gia\",\"Giá thuê từ 3,5 triệu, 4 triệu , 4 ,5 triệu/ tháng\",\"Điện 3,5K/ số\",\"Nước 100k/ người\",\"Phí dịch vụ 50k ( wifi, máy giặt, điện hành lang, thang máy, đổ rác)\",\"Liên hệ; 091274.88.79\",\"Ưu tiên, giảm giá cho khách đặt cọc thuê sớm\"]', 'c573fd24-46da-4370-88e2-38f410d76ccd', '68fb5322-0a63-4afc-8f9e-fb2a9ec78f8c', '34bdb604-3c81-4c92-a939-4330acf8e2b3', '2023-09-01 05:38:27', '2023-09-01 05:38:27'),
