('b5fb507c-829d-4c75-a9b3-e6e1c4f5d544', 'KHAI TRƯƠNG CH MẶT TIỀN ĐƯỜNG NGUYỄN ĐÌNH KHƠI SIÊU ĐẸP CHỈ TỪ 4TR5', '2', 'CTAI', 'Địa chỉ: Nguyễn Đình Khơi, Phường 4, Quận Tân Bình, Hồ Chí Minh', '5a2d1a43-e188-491e-a0ab-fb380a5f0342', 'CTCH', '[\"Khai Trương 9 Phòng CHDV Ngay Mặt Tiền Đường Nguyễn Đình Khơi, xung quanh nhiều tiện ích như chợ, siêu thị, gần Hoàng Sa, Trường Sa thuận tiện qua Q3, Q10.\",\"Phòng full nội thất, đã được decor sẵn.\",\"Giá phòng từ 4tr5 - 7tr5, tùy phòng có ban công hay không.\",\"Vui lòng ib để được tư vấn trực tiếp chính sách tòa nhà.\"]', 'ed42d930-142f-42d8-a95f-aecefbb8eebc', '9bca817e-c589-4342-820e-e9bd10fbb007', 'e03e70ed-9f01-4bb9-8864-da53f5c8c2d2', '2023-09-01 05:38:27', '2023-09-01 05:38:27'),
('be0c5ac9-735d-469f-8989-51ad4cc9f6d6', 'KHAI TRƯƠNG DỰ ÁN - CHỈ CÓ Chốt, có Máy giặt riêng, cửa sổ thoáng', '0', 'CVAA', 'Địa chỉ: Đường Nguyễn Duy Trinh, Phường Bình Trưng Tây, Quận 2, Hồ Chí Minh', '73fd3fcd-358e-41b7-bcc3-93d23e7440ec', 'CTCH', '[\"DUPLEX MỚI KHAI TRƯƠNG - SIÊU SANG SIÊU ĐẸP\",\"Vị trí: Nguyễn Duy Trinh, Quận 2 - Gần ĐH GTVT cs2\",\"Xem là chỉ có chốt\",\"- Phòng được trang bị đầy đủ nội thất mới cao cấp, có máy giặt riêng\",\"- Cửa sổ nhiều thoáng mát, thoải mái\",\"- Thuận tiện di chuyển cách Mai Chí Thọ 3p, Nguyễn Thị Định 2p,...\",\"- Hầm xe siêu rộng, có thang máy rộng\",\"- Giờ giấc tự do ra vào vân tay - có bảo vệ 24/24 - không chung chủ\",\"Lh zalo/call 036.338.1512 (Tuấn Đạt) hỗ trợ xem phòng nhanh chóng và miễn phí tại Quận 2\",\"------------- Hifriendz hỗ trợ cọc ---------------\"]', 'bf75e7aa-6f81-4a28-a4c6-14f0ab00cfbc', '6174a73c-0638-4d43-9719-46ebea79c42e', 'ebea27c8-2b9c-45a5-8385-9aec89d9cb01', '2023-09-01 05:38:27', '2023-09-01 05:38:27'),
('c0e8a01b-f839-41ed-b7ba-15e41fe09e2d', 'Quận 12 - Căn hộ Nhân Đức mới xây dựng - Nội thất sang trọng', '4', 'CVAA', 'Địa chỉ: 338 Đường Nguyễn Văn Quá, Phường Đông Hưng Thuận, Quận 12, Hồ Chí Minh', 'bae822af-b272-48be-9998-c6a6f646af75', 'CTCH', '[\"Cho thuê phòng, có máy lạnh, kệ bếp , an ninh 24/24, có bảo vệ, giờ giấc tự do.\",\"Địa chỉ: Quận 12 - Phường Đông Hưng Thuận - Số nhà 338 Nguyễn Văn Quá\",\"Vị trí:\",\"- Đường lớn nằm cắt 2 tuyến đường huyết mạch giữa Trường Trinh (Tân Bình, Tân Phú) và đường Quang Trung (Gò Vấp)\",\"- Tiện đi lại vì gần trạm xe buýt vào trung tâm qua các Quận Tân Bình, Bình Thạnh, Quận 12, Quận Thủ Đức 10 phút.\",\"- Gần trường đại học, bệnh viện, chợ, KFC, CGV\",\"- Khu dân trí cao, ngay trung tâm Gò Vấp nên gần các khu giải trí cho các bạn thõa sức vui chơi\",\"Tiện ích:\",\"- Diện tích: 20m2 ( rộng rãi ở được 3 4 người )\",\"- Có Máy lạnh mới 100%, kệ bếp bồn rửa.\",\"- Có thang máy tiện lợi.\",\"- Sân thượng rộng rãi phơi đồ\",\"- WC riêng từng phòng, thiết bị cao cấp, nước nóng lạnh.\",\"- Bảo vệ 24/24, camera được trang bị quanh nhà, đảm bảo cho tài sản của bạn được an toàn tuyệt đối.\",\"- Hầm để xe máy rộng rãi, an toàn.\",\"- Giờ giấc tự do, bạn bè, người thân đến chơi thoải mái.\",\"Các chi phí:\",\"- Điện 3.500kWh\",\"- Nước: 100k/người.\",\"- Wifi + rác + vệ sinh: 100k/người\",\"- Xe: 100k/xe\",\"Giá: 2,8 triệu - 4 triệu\",\"Đăc biệt có phòng dành cho các bạn sinh viên : 1,2 - 1,5 triêu/ tháng. (Có máy giặt chung)\",\"Liên hệ: 0987.385.968 - Anh Tâm\"]', 'b1ed2467-6a90-46fa-83f0-05339881772b', '25468e0d-6b67-4808-ab73-15f78b470958', '3a42fcb0-3f6a-4399-90c7-3cce86befef9', '2023-09-01 05:38:27', '2023-09-01 05:38:27'),
('c0f92eed-eb9b-4256-b4a6-cae8b8583061', 'Phòng trọ ngay Thành Thái, trung tâm Quận 10, đẹp, trang bị đầy đủ nội thất', '5', 'CQPN', 'Địa chỉ: Đường Thành Thái, Phường 14, Quận 10, Hồ Chí Minh', '6b3a769f-1dd7-4b78-8470-147fdbf1b25e', 'CTPT', '[\"Cho thuê phòng trọ ngay trung tâm Quận 10, gần ngay Vạn Hạnh Mall, trường đại học Bách Khoa, Huflit (5 phút đi bộ là tới), trường Đại học Y Dược Phạm Ngọc Thạch (bước qua đường là tới) Đại học Hoa Sen, trường Quốc Tế Việt Úc, bệnh viện 115, Nhi Đồng...các nhà thuốc lớn ở HCM... full nội thất đầy đủ tiện nghi, giờ giấc tự do, phòng ốc sạch sẽ và an ninh. Thích hợp cho thuê công tác dài và ngắn hạn, việt Kiều, SV...\",\"Giá phòng: 4.5 triệu - 7 triệu/tháng.\",\"Phòng rộng: từ 25m2 - 35m2.\",\"Phòng đẹp như ảnh, cho thuê tại các địa chỉ sau:\",\"- Địa chỉ 1: 7A/19/19 Thành Thái, P.14, Q.10.\",\"- Địa chỉ 2: 128 Thành Thái, P.12, Q.10\",\"Liên hệ thuê phòng: 0938297275 Anh Việt\"]', 'aadff924-4bc3-46c3-b739-4c0a1c4e4a09', '0fd7279f-a6d8-45f5-a1ac-279383b87929', 'f23bdb70-47e8-496f-b3d7-c5a79d228de8', '2023-09-01 05:39:42', '2023-09-01 05:39:42'),
