giãn\",\"- Cửa ra vào 2 lớp và camera an ninh. Không chung chủ\",\"- Dọn vệ sinh phòng 3 lần/tuần\",\"-----------------------------------\",\"Zalo hoặc gọi 0563063496 để được tư vấn nhiệt tình 24/7 ️️️ Cám ơn\"]', '2d137fe2-0720-47d0-bdf4-d328d329000d', 'd1566b0d-4598-4112-8d96-b09e5fcd52d7', 'cb6059b0-fdcb-4f3f-a4f4-fe72b4bfd935', '2023-09-01 05:39:42', '2023-09-01 05:39:42'),
